import React from 'react'
import {SiGmail , SiGithub} from 'react-icons/si';
import {IoLogoLinkedin} from 'react-icons/io';
import {FaPhoneSquare} from 'react-icons/fa';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

export default function Contact() {
    return (
        <React.Fragment>
                <Row justify-content-center>
                    <div>
                        <Row justify-content-center>
                             <a href="#"><SiGmail className="contactImg"/></a>
                        </Row>
                    </div>
                    <div><Row justify-content-center><a href="#"><IoLogoLinkedin className="contactImg"/></a></Row></div>
                    <div><Row justify-content-center><a href="#"><SiGithub className="contactImg"/></a></Row></div>
                    <div><Row justify-content-center><a href="tel:+91-8892646353"><FaPhoneSquare className="contactImg"/></a></Row></div> 
                </Row>
        </React.Fragment>
    )
}
